INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3585681117140', 'Croustillant Chocolat', 'Préparation sucrée à base d\'huile végétale (eau, huile végétale 25 %, de palme et palmiste, sucre 10 %, glucose, LAIT écrémé en poudre, stabilisants (E420, E466), protéines de LAIT, émulsifiants (E472b, lécithine de SOJA, E471), sel, correcteurs (E340, E331), arômes, sucre, eau, chocolat de couverture au LAIT 8,71 % (sucre, beurre de cacao, poudre de LAIT entier, pâte de cacao, émulsifiant : lécithine de SOJA, arôme naturel de vanille), CRÈME UHT (CRÈME, stabilisant E407), chocolat noir 6,68 % (pâte de cacao, sucre fondant en poudre (sucre, sirop de glucose), ŒUF entier, huile de tournesol, pâte de NOISETTE 4,65 % brisures de crêpe dentelle (farine de BLÉ, sucre, BEURRE concentré, huile de tournesol, LAIT écrémé en poudre, malt d\'ORGE, sel), graisse végétale de coprah, cacao en poudre 2,57 %, sirop de glucose, farine de BLÉ, farine de BLE, poudre de blanc d\'ŒUF (blanc d\'ŒUF, correcteur d\'acidité E330, agent moussant E1505), fourrage au praliné 0,87 % (praliné 93 % (sucre, NOISETTE, AMANDE), huile de tournesol, sucre émulsifiant lécithine de SOJA, poudre d\'AMANDE 0,55 %, beurre de cacao, épaississant: gomme xanthane.', 'https://static.openfoodfacts.org/images/products/358/568/111/7140/front_fr.4.400.jpg', '17.59', '8.02', '31.03', '24.12', '', '3.32', '0.173', '0.0681102362204724', '', '1');

