INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3585808000126', 'Sablé au thé', 'Farine de blé (gluten), beurre pâtissier (lait), sucre, jaunes d\'œuf, infusion de thé 5,7 % (eau, thé Prince Wladimir), stabilisant : sucre inverti, sel, poudre à lever (diphosphate disodique, carbonate acide de sodium) , huile essentielle orange, extrait de vanille naturelle, acidifiant : acide citrique. Peut contenir des traces de fruits à coque, arachides et soja. Ingredients: Wheat flour (gluten), concentrated butter (milk), sugar, egg yolks, tea infusion 5,7 % (water, Prince NAadimir tea), stabilizer: invert Sugar, salt, raising agent (disodium dihydrogen diphosphate, sodium hydrogen carbonate), orange essential oil, natural vanilla extract, acidifier: citric acid. May contain traces of nuts, peanuts and soja. Ingredienser: (gluten), koncentreret smor/smôr (melkîmjôlk), sukker/socker, eggeblommer/ âggulor, teinfusion (Vand/vatten, te Prince Vladimir), stabilisator/stabiliseringsmedel: invertsukker/ invertsocker, salt, h?vemidler/jâsningsmedel (dinatriumdiphosphat, natriumhydrogencarbonat), appelsin ?terisk Olie /apelsin eterisk olja, naturlig vaniljeekstrakt/naturligt vaniljextrakt, surhedsregulerende middel/ surhetsreglerande medel: citronsyre/citronsyra. Kan indeholde spor af valnodder, hasselnodder, mandler, jordnodder og soja/ Kan innehàlla spàr av valnôtter, hasselnôtter, mandlar, jordnôtter och soja. %utaten: Weizenmehl (Gluten), Butterschmaltz (Milch), Zucker, Eigelb, Krâutertee 5,7 % (Wasser, Tee Prince Vladimir), Stabilisator: Invertzucker, Salz, Backtriebmittel (Dinatriumdiphosphat, Natriumhydrogencarbonat), âtherische 01, natürlicher Vanille Extract, Sâuerungsmittel: Citronensâure. Kann Spuren von Schalenfrüchte, Ernüssen und Soja enthalten. Ingredienti: Farina di frumento (glutine), burro concentrato (latte), zucchero, tuorli d\'uovo, infusione di tè 5,7 % (acqua, tè Prince Vladimir) , stabilizzante: zucchero invertito, sale, polvere levitante (difosfato disodico, carbonato acido di sodio), olio essenziale di arancio, estratto naturale di vaniglia, acidificante: acido citrico. Può contenere tracce di frutta a guscio, arachidi e soia. Ingredientes: Harina de trigo (gluten), mantequilla concentrada (leche), azücar, yemas de huevos, infusiôn de té 5,7 % (agua, té Prince Vladimir) , estabilizante: azûcar invertido, sal, levadura (difosfato disôdico, carbonato âcido de sodio) , aceite esencial de naranja, extracto natural de vainilla, acidificante: acido citrico. Puede contener trazas de frutos de câscara, cacahuetes y soja.', 'https://static.openfoodfacts.org/images/products/358/580/800/0126/front_fr.4.400.jpg', '29', '20', '60', '29', '1.8', '5.5', '0.7', '0.275590551181102', '', '0');

