VALUES ('3585810047577', 'Matcha', 'IJSMI TEA pARlS Le matcha est un thé vert du Japon dont les feuilles ont été broyées entre deux pierres. Il est utilisé dans les desserts japonais, autant pour son goût que pour la couleur qu\'il donne aux préparations Sa saveur végétale et légèrement amère se marie parfaitement goûts sucrés et leur apporte une touche de sophisticaüon. Retrouver les recettes à base de matcha : Matcha is T Japanese green tea made from leaves which have been ground between two stones. It is used in Japanese desserts bothfor its taste and for its colour. Its leafy taste is slightly bitter, making it the perfect ingredient to add a touch of sophistication to Find matcha-based recipes at www.kusmitea.com', 'https://static.openfoodfacts.org/images/products/358/581/004/7577/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '0', '0', '0', '', '1');

